import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function ConstructGraph() {
  const [stsName, setStsName] = useState("");
  const [graphName, setGraphName] = useState("");

  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    // if (!name || !email) return;
    alert("congrats!");
    //callAPI
    navigate("/load-sts");
  };

  return (
    <section className="section">
      <form className="form" onSubmit={handleSubmit}>
        <h4>Construct Graph</h4>
        <br />
        <br />
        <br />
        <div className="form-row">
          <label htmlFor="stsName" className="form-label">
            Select the SQL Tuning Set:
          </label>
          <Select
            type="select"
            className="form-input"
            id="stsName"
            value={stsName}
            required
            onChange={(e) => setStsName(e.target.value)}
          >
            <option>STS1</option>
            <option>STS2</option>
          </Select>
        </div>
        <div className="form-row">
          <label htmlFor="graphName" className="form-label">
            Enter the Graph name:
          </label>
          <input
            type="text"
            className="form-input"
            id="graphName"
            required
            value={graphName}
            onChange={(e) => setGraphName(e.target.value)}
          />
        </div>

        <br />
        <button type="submit" className="btn btn-block">
          Load STS
        </button>
        <br />
        <br />
        <br />
        <br />
      </form>
    </section>
  );
}

export default ConstructGraph;
